samples.schema:
{
  "id": "simple-feedback-survey",
  "title": "Customer Feedback Survey",
  "description": "A simple 3-question feedback survey with no branching logic",
  "startNodeId": "start",
  "nodes": {
    "start": {
      "id": "start",
      "type": "start",
      "content": {
        "title": "Welcome!",
        "message": "Thank you for taking the time to share your feedback with us. This survey will only take a minute."
      },
      "next": [
        {
          "nodeId": "q1"
        }
      ]
    },
    "q1": {
      "id": "q1",
      "type": "question",
      "content": {
        "question": "What's your name?",
        "type": "text",
        "required": true,
        "placeholder": "Enter your name"
      },
      "next": [
        {
          "nodeId": "q2"
        }
      ]
    },
    "q2": {
      "id": "q2",
      "type": "question",
      "content": {
        "question": "How would you rate our service?",
        "type": "rating",
        "required": true,
        "min": 1,
        "max": 5
      },
      "next": [
        {
          "nodeId": "q3"
        }
      ]
    },
    "q3": {
      "id": "q3",
      "type": "question",
      "content": {
        "question": "Any additional comments?",
        "type": "text",
        "required": false,
        "placeholder": "Share your thoughts..."
      },
      "next": [
        {
          "nodeId": "end"
        }
      ]
    },
    "end": {
      "id": "end",
      "type": "end",
      "content": {
        "title": "Thank You!",
        "message": "We appreciate your feedback. Your responses help us improve our service."
      },
      "next": []
    }
  }
}

{
  "id": "nps-survey",
  "title": "Net Promoter Score Survey",
  "description": "Simple NPS survey with branching logic based on score",
  "startNodeId": "start",
  "nodes": {
    "start": {
      "id": "start",
      "type": "start",
      "content": {
        "title": "Welcome!",
        "message": "Thank you for taking the time to share your feedback with us. This will only take a minute."
      },
      "next": [
        {
          "nodeId": "nps-question"
        }
      ]
    },
    "nps-question": {
      "id": "nps-question",
      "type": "question",
      "content": {
        "question": "How likely are you to recommend us to a friend or colleague?",
        "description": "Please rate on a scale from 0 (not at all likely) to 10 (extremely likely)",
        "type": "nps",
        "required": true,
        "min": 0,
        "max": 10
      },
      "next": [
        {
          "condition": {
            "operator": "greaterOrEqual",
            "value": 9
          },
          "nodeId": "promoter-question"
        },
        {
          "condition": {
            "operator": "greaterOrEqual",
            "value": 7
          },
          "nodeId": "passive-question"
        },
        {
          "condition": {
            "operator": "lessOrEqual",
            "value": 6
          },
          "nodeId": "detractor-question"
        }
      ]
    },
    "promoter-question": {
      "id": "promoter-question",
      "type": "question",
      "content": {
        "question": "What do you love most about our product or service?",
        "description": "We'd love to know what we're doing right!",
        "type": "text",
        "required": false,
        "placeholder": "Share what you appreciate most..."
      },
      "next": [
        {
          "nodeId": "end"
        }
      ]
    },
    "passive-question": {
      "id": "passive-question",
      "type": "question",
      "content": {
        "question": "What would make you rate us higher?",
        "description": "Help us understand what we could improve",
        "type": "text",
        "required": false,
        "placeholder": "Tell us what would make a difference..."
      },
      "next": [
        {
          "nodeId": "end"
        }
      ]
    },
    "detractor-question": {
      "id": "detractor-question",
      "type": "question",
      "content": {
        "question": "What went wrong?",
        "description": "We're sorry to hear you had a poor experience. Please help us understand what happened.",
        "type": "text",
        "required": false,
        "placeholder": "Share your concerns..."
      },
      "next": [
        {
          "nodeId": "detractor-issues"
        }
      ]
    },
    "detractor-issues": {
      "id": "detractor-issues",
      "type": "question",
      "content": {
        "question": "Which of the following issues did you experience?",
        "description": "Select all that apply",
        "type": "multiChoice",
        "required": false,
        "options": [
          {
            "id": "issue-1",
            "label": "Poor customer service",
            "value": "customer-service"
          },
          {
            "id": "issue-2",
            "label": "Product quality issues",
            "value": "product-quality"
          },
          {
            "id": "issue-3",
            "label": "Pricing concerns",
            "value": "pricing"
          },
          {
            "id": "issue-4",
            "label": "Technical problems",
            "value": "technical"
          },
          {
            "id": "issue-5",
            "label": "Delivery or shipping issues",
            "value": "delivery"
          },
          {
            "id": "issue-6",
            "label": "Other",
            "value": "other"
          }
        ]
      },
      "next": [
        {
          "nodeId": "end"
        }
      ]
    },
    "end": {
      "id": "end",
      "type": "end",
      "content": {
        "title": "Thank you!",
        "message": "We appreciate you taking the time to share your feedback. Your input helps us improve and serve you better."
      },
      "next": []
    }
  }
}

{
  "id": "product-satisfaction",
  "title": "Product Satisfaction Survey",
  "description": "Help us understand your experience with our product",
  "startNodeId": "start",
  "nodes": {
    "start": {
      "id": "start",
      "type": "start",
      "content": {
        "message": "Thank you for purchasing from us! Please take a moment to share your experience.",
        "title": "Product Feedback"
      },
      "next": [
        {
          "nodeId": "q1"
        }
      ]
    },
    "q1": {
      "id": "q1",
      "type": "question",
      "content": {
        "question": "Which product did you purchase?",
        "type": "choice",
        "required": true,
        "options": [
          {
            "id": "a",
            "label": "Product A - Basic",
            "value": "product_a"
          },
          {
            "id": "b",
            "label": "Product B - Standard",
            "value": "product_b"
          },
          {
            "id": "c",
            "label": "Product C - Premium",
            "value": "product_c"
          }
        ]
      },
      "next": [
        {
          "nodeId": "q2"
        }
      ]
    },
    "q2": {
      "id": "q2",
      "type": "question",
      "content": {
        "question": "Rate the overall quality",
        "type": "rating",
        "required": true,
        "min": 1,
        "max": 5
      },
      "next": [
        {
          "nodeId": "q3"
        }
      ]
    },
    "q3": {
      "id": "q3",
      "type": "question",
      "content": {
        "question": "Rate the value for money",
        "type": "rating",
        "required": true,
        "min": 1,
        "max": 5
      },
      "next": [
        {
          "nodeId": "q4"
        }
      ]
    },
    "q4": {
      "id": "q4",
      "type": "question",
      "content": {
        "question": "The product met my expectations",
        "type": "likert",
        "required": true,
        "likertScale": 5,
        "likertLabels": {
          "start": "Strongly Disagree",
          "end": "Strongly Agree"
        }
      },
      "next": [
        {
          "nodeId": "q5"
        }
      ]
    },
    "q5": {
      "id": "q5",
      "type": "question",
      "content": {
        "question": "What features do you like most?",
        "type": "multiChoice",
        "required": true,
        "options": [
          {
            "id": "design",
            "label": "Design & Aesthetics",
            "value": "design"
          },
          {
            "id": "ease",
            "label": "Ease of Use",
            "value": "ease"
          },
          {
            "id": "performance",
            "label": "Performance",
            "value": "performance"
          },
          {
            "id": "durability",
            "label": "Durability",
            "value": "durability"
          },
          {
            "id": "price",
            "label": "Price Point",
            "value": "price"
          }
        ],
        "maxSelections": 3
      },
      "next": [
        {
          "nodeId": "q6"
        }
      ]
    },
    "q6": {
      "id": "q6",
      "type": "question",
      "content": {
        "question": "Any suggestions for improvement?",
        "type": "text",
        "required": false,
        "placeholder": "Share your ideas (optional)"
      },
      "next": [
        {
          "nodeId": "end"
        }
      ]
    },
    "end": {
      "id": "end",
      "type": "end",
      "content": {
        "message": "Thank you for your valuable feedback!",
        "title": "Survey Complete"
      },
      "next": []
    }
  }
}
